import * as React from 'react';
import { CssBaseline, Link, Avatar, TextField, Typography, Paper, Box, Grid, Button, Checkbox, FormControlLabel, Container } from '@material-ui/core';

import CastleIcon from '@material-ui/icons/PhoneLocked';

import { createTheme, ThemeProvider } from '@material-ui/core';
import PhoneLocked from '@material-ui/icons/ScreenLockLandscape';



const Auth = () => {
    const classes = useStyles();

    return (
        <Container>
            <paper  >

                <Box><Avatar><PhoneLocked /></Avatar> Sign In </Box>
                <form className={classes.form}>
                    <Box >    <TextField

                        name="email"
                        required
                        id="email"
                        label="Email"
                        variant="filled"
                        onChange=''
                    />
                        <TextField

                            name="password"
                            required
                            id="password"
                            label="Password"
                            variant="filled"
                            type="password"
                            onChange=''
                        />

                    </Box>
                </form>
            </paper>


        </Container>

    );
}
export default Auth;
